import React, { useState, useEffect } from "react";
import { Link, Navigate, NavLink } from "react-router-dom";
import axios from "axios";
import Header from "./Header";
import "./bgstatic.css";

const myStyle = {
    backgroundImage: 'url("/bg.jpg"})',
    height: "100vh",
    marginTop: "-70px",
    fontSize: "50px",
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };

const LandinPage = () => {
  const [search, setSearch] = useState(null);
  const [data, setData] = useState([]);
  const [tokenn, setTokenn] = useState(localStorage.getItem("token"));
  const [y, setY] = useState("");
  
  if (!localStorage.getItem("token")) {
    return <Navigate to="/login" />;
  }
  console.log(tokenn);

  return (
    <div className="first">
      <Header />

      <section className="container">
        <center>
          {" "}
          <h1
            className="large "
            style={{ color: "#30332E", marginTop: "20px" }}
          >
            Welcome to Venture Hub
          </h1>
        </center>

        <nav className="navbar navbar-light">
          <div className="container-fluid">
            <center>
                <h3>
                    A student acivity website made by students for students.
                </h3>
                <br/>
                <br/>
                <br/>
                <li className="nav-link ">
                <NavLink to="/roommatesearch" className="nav-link" style={({ color : '#000000' })}>
                    Click here to browse for roommates
                </NavLink>
            </li>
            <br/>
            <br/>
            <img 
                            className="round-img"
                            src="https://cdni.iconscout.com/illustration/premium/thumb/events-4352689-3611150.png?f=webp"
                            height="250" width="450"
                            alt="pix"
            />
            <button className="nav-link ">
                <NavLink to="/eventsearch" className="nav-link" style={({ color : '#000000' })}>
                    Click here to browse events
                </NavLink>
            </button>
            </center>
          </div>
        </nav>

      </section>

      {tokenn === "undefined" && <Navigate to="/login" />}
    </div>
  );
};

export default LandinPage;
